import React from 'react'
import './Education.css'

const Education = ({details}) => {
  return (
    <div className='work-experience-card'>
        <h6>{details.title}</h6>
        <div className='work-duration'>{details.date}</div>
        <ul>
          {details.responsi}
        </ul>
      
    </div>
  )
}

export default Education
